  false,\n\t\"url\": null,\n\t\"notes\": \"In 2005, volunteers were trained on the
  use of GPS units and weed identification. They mapped 3,000 acres of previously
  burned areas to determine the incidence of post-burn cheat grass infestation. Volunteers
  also searched 100 acres of meadow ground looking for noxious weeds. GIS layers were
  produced from all findings. Priority areas were identified for future weed treatments.\",\n\t\"license_title\":
